			<Snippet maxLines="0" id="khSnippet26452"></Snippet>
			<description><![CDATA[<p>On October 17, 1989, at 5:04:15 p.m. (p.d.t.), a magnitude 6.9 earthquake severely shook the San Francisco and Monterey Bay regions. The epicenter was located near Loma Prieta peak in the Santa Cruz Mountains. The earthquake occurred when the Pacific and North American Plates abruptly slipped as much as 2 meters (7 ft) along their common boundary-the San Andreas fault system. The rupture initiated at a depth of 18 km (11 mi) and extended 35 km (22 mi) along the fault, but it did not break the surface of the Earth. <br>
For more information: <a href="http://earthquake.usgs.gov/regional/states/events/1989_10_18.php/" >Loma Prieta Earthquake</a>
</p>
<img src= "http://earthquake.usgs.gov/regional/nca/virtualtour/kml/images/1989Rupture.png">]]></description>
