			<Snippet maxLines="0" id="khSnippet26434"></Snippet>
			<description><![CDATA[<p>In the Great 1906 magnitude 7.8 earthquake, nearly 300 miles (480 Km) of the San Andreas Fault ruptured, producing strong shaking along all of coastal northern California. Shaking was most intense in Santa Rosa and San Francisco. In San Francisco, broken water mains kept firefighters from battling the fires that swept through the city and contributed to the devastation shown in the photograph below (looking south) taken from a tethered balloon 5 weeks after the earthquake. <br>
For more information: <a href="http://1906centennial.org/">1906 Earthquake Centennial</a>
</p>
<img src= "http://earthquake.usgs.gov/regional/nca/virtualtour/kml/images/1906Rupture.png">]]></description>
