			<Snippet maxLines="0" id="khSnippet26470"></Snippet>
			<description><![CDATA[<p>The magnitude 7.9 Fort Tejon earthquake in 1857 caused a horizontal shift of about 30 feet (9 m) on this stretch of the southern San Andreas Fault (red arrows indicate this "strike-slip" movement). Although the quake ruptured nearly 200 miles (300 km) of the fault, it did little damage because southern California’s population was small at that time.<br>
For more information: <a href="http://earthquake.usgs.gov/regional/states/events/1857_01_09.php">Fort Tejon Earthquake</a>
</p>
<img src= "http://earthquake.usgs.gov/regional/nca/virtualtour/kml/images/1857Rupture.png">]]></description>
