			<Snippet maxLines="0" id="khSnippet2205"></Snippet>
			<description><![CDATA[<p>In this computer simulation, tsunami waves are radiating outward after a magnitude 9 earthquake that occurred on the Cascadia Subduction Zone offshore of northern California, Oregon and Washington on January 26, 1700. This view shows the waves 4 hours after the quake. Colors indicate wave heights—red is highest. Along parts of the coast of the Pacific Northwest, 30-foot-high (9 m) waves rushed inland. Within 20 hours the tsunami did damage throughout the Pacific, and it is well documented in written records from Japan. <br> 
For more information: <a href="http://pubs.usgs.gov/circ/c1187/">Tsunami, USGS</a> or <a href="http://pubs.usgs.gov/pp/pp1707/"> Orphan Tsunami</a> </p>
<img src= "http://earthquake.usgs.gov/regional/nca/virtualtour/kml/images/1700Rupture.png">]]></description>
