	<Document>
		<name>1906 Shaking Reports</name>
		<description><![CDATA[<p>Individual accounts of the 1906 earthquake. </br>
From <a href="http://pubs.usgs.gov/of/2005/1135/">USGS</a> publication.</p>]]></description>
		<Style id="khStyle13409">
			<IconStyle id="khIconStyle13410">
				<scale>0.9</scale>
				<Icon>
					<href>https://myapp33bucket.s3.amazonaws.com/Quotes_icon.png</href>
				</Icon>
			</IconStyle>
			<LabelStyle id="khLabelStyle13412">
				<color>00ffffff</color>
			</LabelStyle>
		</Style>
		<Placemark>
			<name>Albion</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;[James Coyle] was thrown violently to the ground, as were several cattle and horses that were grazing nearby. Large rocks were seemingly squeezed out of the hillside and rolled into the river. Many houses and bridges were thrown down.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-123.7675,39.22361,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Calaveras Valley</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;all the brick chimneys were thrown down, tho there were only a few ...No damage to houses is reported.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-121.8193,37.4677,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Central San Joaquin County</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;no objects or chimneys were overthrown. Windows and window weights rattled. Paper on the walls was cracked. The roof on a high church tower was cracked ... large trees swayed and bent as if rocked by a terrible gale.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-121.23081,37.98102,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Cooley&apos;s Landing, near Dumbarton Bridge</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;No damage but broken chimneys was noticeable ...One house on a poor foundation was knocked down.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point id="khPoint80654">
				<coordinates>-122.12986,37.49774000000001,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Davisville, now Davis</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;Some plaster was cracked and doors were jammed so they required resetting.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-121.73944,38.545,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Dudley Sation, near Cottonwood Canyon</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;Nothing on the shelves was disturbed, nor had milk or water slopt over.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-120.10616,35.79403,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Emmet Station, SE of Paicines</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;Milk was thrown out in small quantities, but no movable objects were upset or moved.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-121.16666,36.65001,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Fort Ross</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;chimney tops were thrown off ...Many redwood and pine trees were broken off ...about halfway up.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-123.24339,38.51533000000001,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Gilroy</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;nearly every chimney fell, fire-walls of brick buildings were thrown down.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-121.56722,37.00583,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Healdsburg</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;many brick buildings stood the shock without serious damage.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-122.86806,38.61056,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Idlewild, Little Sur River</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;Several articles were thrown from shelves&quot; and &quot;redwoods swayed considerably.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point id="khPoint87604">
				<coordinates>-121.88,36.33,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Inverness</name>
			<Snippet maxLines="0"></Snippet>
			<description>“[half the houses] were shifted on their foundations. A number of persons were thrown violently from their beds.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-122.85583,38.10111,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Knight&apos;s Landing</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;small ornaments were thrown in all directions.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-121.71722,38.79972000000001,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Los banos</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;all the brick chimneys were damaged ...17 out of 30 fell.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-120.84889,37.05833,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Los Muertos Valley</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;In Brown&apos;s, Los Muertos, and Quien Sabe Valleys, the shock was only sufficient to throw cream from pans of milk.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-121.119,36.74,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Maacama</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;two horses were thrown down.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-122.77385,38.63665,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Marshall</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;a hotel and a stable ...went easily and gently into the bay. The occupants of the hotel did not realize that the hotel had fallen, but at first thought that the water had risen.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-122.89306,38.16055,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Milpitas</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;nearly all the chimneys were thrown down... (but) the destruction seems insignificant. The hotel slipt on its foundations, but was almost repaired.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-121.90556,37.42833,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Olive Springs</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;a landslide demolished the Loma Prieta Mill and killed 9 men.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-121.92783,37.06108,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Pescadero</name>
			<Snippet maxLines="0"></Snippet>
			<description>“all but 3 brick chimneys fell, but few buildings were otherwise damaged. All the water tanks observed were still standing, and none of the churches had lost their steeples, tho one church was cracked open.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-122.38028,37.255,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Pleyto, now San Antonio Reservoir</name>
			<Snippet maxLines="0"></Snippet>
			<description>“[The shock] hardly more than wakened sleepers.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-120.9925,35.86028,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>San Leandro</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;nearly every chimney was down. houses were not seriously damaged, and only two have been condemned.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-122.155,37.725,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>San Lucas</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;milk and water were spilt and shelf goods disturbed&quot;; &quot;waves were reported to have been seen moving southward over the hills</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-121.01893,36.12872,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>San Mateo Point, now Coyote Point</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;The alluvial flats around the point showed some small cracks. Half a mile west, part of the wharf was broken, lumber piles were overturned, and a chimney fell.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-122.32805,37.58445,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>San Vicente Lime Quarries, at Davenport</name>
			<Snippet maxLines="0"></Snippet>
			<description>&quot;Little or no damage was done to the buildings or furnaces,&quot; but &quot;men could not walk to the door of the cook-house.&quot;</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-122.19295,37.01271,0</coordinates>
			</Point>
		</Placemark>
		<Placemark>
			<name>Santa Rosa</name>
			<Snippet maxLines="0"></Snippet>
			<description>“Twenty to twenty-five residences were thrown to the ground by the collapse of their underpinnings.”</description>
			<styleUrl>#khStyle13409</styleUrl>
			<Point>
				<coordinates>-122.70602,38.45754,0</coordinates>
			</Point>
